function Menu() {
	return (
  	<ul className="menu">
  	  <Link href="/"><img src="https://raw.githubusercontent.com/devicons/devicon/master/icons/git/git-original.svg" width="30" height="30"/></Link>
      <Link href="/"><img src="https://raw.githubusercontent.com/devicons/devicon/master/icons/react/react-original.svg" width="30" height="30"/></Link>
      <Link href="/"><img src="https://raw.githubusercontent.com/devicons/devicon/master/icons/javascript/javascript-original.svg" width="30" height="30"/></Link>
      <Link href="/"><img src="https://raw.githubusercontent.com/devicons/devicon/master/icons/php/php-original.svg" width="30" height="30"/></Link>
      <Link href="/"><img src="https://raw.githubusercontent.com/devicons/devicon/master/icons/html5/html5-original.svg" width="30" height="30"/></Link>
       <Link href="/"><img src="https://raw.githubusercontent.com/devicons/devicon/master/icons/sass/sass-original.svg" width="30" height="30"/></Link>
  	</ul>
  );
}

function Link({ href, children }){
	return (
  		<li>
  		  <a href={href}>{children}</a>
  		</li>
  )
}

const user = {
	name: 'Edilson Santos',
  profile: 'DevOps Fullstack',
  imageUrl: 'https://e7.pngegg.com/pngimages/799/987/png-clipart-computer-icons-avatar-icon-design-avatar-heroes-computer-wallpaper-thumbnail.png',
  imageSize: '35',
};

const Experiencias = [
  { title: 'React', id: 1, value: 30 },
  { title: 'Sass', id: 2, value: 56 },
  { title: 'JavaScript', id: 3, value: 70 }
];

function SeparatorList() {
  return (
    <ul className="list_skins">
      {Experiencias.map(experiencia => (
        <li className="item_skin" key={experiencia.id} id={experiencia.id}>
          {experiencia.title} <br />
          <progress value={experiencia.value} max={100} />
        </li>
      ))}
    </ul>
  );
}

function Button() {
		return (
    		<a href="https://wa.me/5511991680375" className="btn-contato">
    		    <div>Entrar em contato</div>
    		</a>
    );
}
